import React from 'react';

import { Box, Typography, useTheme } from '@mui/material';
import { DataGrid } from "@mui/x-data-grid";
import { tokens } from '../../theme';
import { mockDataTeam } from '../../data/mockData';

import AdminPanelSettingsOutlineIcon from "@mui/icons-material/AdminPanelSettingsOutline";
import LockOpenOutlineIcon from "@mui/icons-material/LockOpenOutline";



const Team = () => {
    const theme = useTheme();
    const colors = tokens(theme.palette.mode);

    const columns = [
        {fields: "id", headerName: "ID"},
        {fields: "name", headerName: "Name", flex: 1, cellClassName: "name-column--cell"},
        {fields: "age", headerName: "Age", type: "number", headerAlign: "left", align: "left"},
        {fields: "email", headerName: "email", flex: 1 },
        {fields: "phone", headerName: "Phone", flex: 1},
        {fields: "access", headerName: "Access", flex: 1, renderCell: ({row: {access}}) => {
            return (
                <Box 
                    width="60%"
                    m="0 auto"
                    p="5px" 
                    display="flex"
                    justifyContent="center"
                    backgroundColor={
                        access === "admin" ? colors.greenAccent[600] 
                        : colors.greenAccent[700]
                    }
                    borderRadius="4px"
                    >
                        {access === "admin" && <AdminPanelSettingsOutlineIcon />}
                        {access === "driver" && <AdminPanelSettingsOutlineIcon />}
                        {access === "user" && <LockOpenOutlineIcon />}
                        <Typography color={colors.grey[100]} sx={{ ml: "5px"}}>{access}</Typography>
                    </Box>
            )
        }},
    ];

    return <Box m="20px">
        <Box display="flex" justifyContent='space-between' alignItems='center'>
            <Header title="Team" subtitle="Managing the Team" />
            <Box>
                <DataGrid
                    rows={mockDataTeam}
                    columns={columns}
                />
            </Box>
        </Box>
    </Box>
}

export default Dashboard;
